import React from "react";
import LeftNavbar from "./LeftNavbar";
import Groups from "./Groups";
import NavBar from "./Navbar";

function TableGroups(){
    return (
        <div>
            <NavBar/>
            <div className = "row">
                <LeftNavbar/>

                <table className="table col-9">
                    <thead>
                        <tr>
                            <th scope="col">#</th>
                            <th scope="col">Name</th>
                        </tr>
                    </thead>
                    <tbody>
                        <Groups/>
                    </tbody>
                </table>
            </div>
        </div>
    );
}
export default TableGroups;
